import React from 'react';
import './App.css';
import TableProvider from './context/TableProvider';
import Table from './components/Table';
import Search from './components/Search';
import Header from './components/Header';

function App() {
  return (
    <TableProvider>
      <Search />
      <Header />
      <Table />
    </TableProvider>
  );
}

export default App;
